import React, { useContext } from "react";
import "./Works.css";
import mui from "../../img/mui.png";
import vscode from "../../img/vscode.png";
import download from "../../img/download.jpg"
import ws from "../../img/ws.png";
import javascript from "../../img/javascript.png";
import { themeContext } from "../../Context";
import { motion } from "framer-motion";
import {Link} from 'react-scroll'
const Works = () => {
  // context
  const theme = useContext(themeContext);
  const darkMode = theme.state.darkMode;

  // transition
  return (
    <>
    <div className="works" id="works">
      {/* left side */}
      <div className="w-left">
        <div className="awesome">
          {/* dark Mode */}
          <span style={{ color: darkMode ? "white" : "" }}>
          Heroku
          </span>
          <span>Netlify</span>
          <spane>
            I use them to create beautiful websites. I am expert in all these. I
            <br />
            have also done jobs in some places with my work. Due to which  
            <br />
            i am good experience in my work.
            <br />
            <br />
            I always try to work according to the customer's thinking.
          </spane>
          <Link to="contact" smooth={true} spy={true}>
            <button className="button s-button">Hire Me</button>
          </Link>
          <div
            className="blur s-blur1"
            style={{ background: "#ABF1FF94" }}
          ></div>
        </div>

        {/* right side */}
      </div>
      <div className="w-right">
        <motion.div
          initial={{ rotate: 45 }}
          whileInView={{ rotate: 0 }}
          viewport={{ margin: "-40px" }}
          transition={{ duration: 3.5, type: "spring" }}
          className="w-mainCircle"
        >
          <div className="w-secCircle">
            <img src={download} alt="" />
          </div>
          <div className="w-secCircle">
            <img src={mui} alt="" />
          </div>
          <div className="w-secCircle">
            <img src={vscode} alt="" />
          </div>{" "}
          <div className="w-secCircle">
            <img src={ws} alt="" />
          </div>
          <div className="w-secCircle">
            <img src={javascript} alt="" />
          </div>
        </motion.div>
        {/* background Circles */}
        <div className="w-backCircle blueCircle"></div>
        <div className="w-backCircle yellowCircle"></div>
      </div>    
      </div>
    </>
  );
};

export default Works;
